package ch.ninecode.sc

import scala.collection.mutable

import org.scalatest.FunSuite

class TraceRouteSuite extends FunSuite
{
    def traceroute (start: String, data: Iterable[(String, String, Double)])
    {
        val tr = new TraceRoute ()
        val answer = tr.traceroute (start, data)
        println (answer.mkString ("\n"))
        assert (answer.size <= 1)
        if (answer.nonEmpty) // eliminate branches that have no fuse
        {
            println (answer.head.asString)
            assert (answer.head.from == start)
            assert (answer.head.to == "source")
        }
    }

